import React from 'react';
import logo from './logo.svg';
import './App.css';

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      title: "Bryan Ge | Portfolio",
      headerLinks: [
        { title: 'Home', path: '/'},
        { title: 'About', path: '/about'},
        { title: 'Resume', path: 'https://drive.google.com/file/d/1H4-sfzxQG9cpSsKMzuQUFK3NX5h8d0V5/view?usp=sharing'}
      ],
      home: {
        title: Be
      }
    }
  }
  render() {
    return (
      <div>Hello from React!</div>
    );
  }
}

export default App;
